import React, { Fragment, Component } from 'react';
import ReactDOM from 'react-dom';
import { makeStyles } from '@material-ui/core/styles';
import IconButton from '@material-ui/core/IconButton';
import FaceTwoToneIcon from '@material-ui/icons/FaceTwoTone';
import Paper from '@material-ui/core/Paper';
import ChildFriendlyTwoToneIcon from '@material-ui/icons/ChildFriendlyTwoTone';
import CakeTwoToneIcon from '@material-ui/icons/CakeTwoTone';
import MoreVertOutlinedIcon from '@material-ui/icons/MoreVertOutlined';
import MediaQuery from 'react-responsive';
import DashboardTwoToneIcon from '@material-ui/icons/DashboardTwoTone';
import FilterDramaTwoToneIcon from '@material-ui/icons/FilterDramaTwoTone';
import CssBaseline from '@material-ui/core/CssBaseline';
import Typography from '@material-ui/core/Typography';
import Container from '@material-ui/core/Container';

const useStyles = makeStyles((theme) => ({
  icon: {
    '& svg': {
      fontSize: 20
    },
    '&:hover': {
      backgroundColor: 'transparent'
    }
  },
  menu: {
    display: 'flex',
    flexWrap: 'wrap',
    justifyContent: 'flex-end',
    '& > *': {
      margin: theme.spacing(0),
      height: theme.spacing(5),
    }
  }
}));

function SvgIconsSize() {
const classes = useStyles();
  return (
	<React.Fragment>
                <MediaQuery minDeviceWidth={1224}>
<div></div><div className={classes.menu}>
                        <Paper elevation={2} style={{display: 'flex', justifyContent:'flex-end'}}>
                                <IconButton className={classes.icon}>
                                        <MoreVertOutlinedIcon />&nbsp;
					<DashboardTwoToneIcon style={{color:'#0275d8'}}/>&nbsp;<strong><span style={{color:'#0275d8', fontSize:'18px'}}>Service</span></strong>
				</IconButton>
			</Paper>
			<Paper elevation={2} style={{display: 'flex', justifyContent:'flex-end'}}>
				<IconButton className={classes.icon}>
                                        <MoreVertOutlinedIcon />&nbsp;
                                        <FilterDramaTwoToneIcon style={{color:'#5cb85c'}}/>&nbsp;<strong><span style={{color:'#5cb85c', fontSize:'18px'}}>Product</span></strong>
                                </IconButton>
                        </Paper>
                        <Paper elevation={2} style={{display: 'flex', justifyContent:'flex-end'}}>
                                <IconButton className={classes.icon}>
					<MoreVertOutlinedIcon />&nbsp;
                                        <FaceTwoToneIcon style={{color:'#f0ad4e'}}/>&nbsp;<strong><span style={{color:'#f0ad4e', fontSize:'18px'}}>About Us</span></strong>&nbsp;
                                </IconButton>
                        </Paper>
                        </div>
                </MediaQuery>
                <MediaQuery maxDeviceWidth={1224}>
		<div></div>
                </MediaQuery>
                <MediaQuery orientation='portrait'>
		<div></div>
                </MediaQuery>
                <MediaQuery orientation='landscape'>
		<div></div>
                </MediaQuery>

                <MediaQuery minResolution='2dppx'>
		<div></div>
                </MediaQuery>
<CssBaseline />
      <Container maxWidth="lg">
        <Typography component="div" style={{ backgroundColor: '#cfe8fc' }} />
      </Container>
            </React.Fragment>
	);
}

ReactDOM.render(
  // Try changing to isLoggedIn={true}:
  <SvgIconsSize />,
  document.getElementById('root')
);
